import React from "react";
import "../styles/Banner.css";

const Banner = props => {
  return (
    <header>
      <div className="app-container">
        <h1 className="header-title">Sudoku</h1>
        <h2 className="header-subtitle">Made in react</h2>
      </div>
    </header>
  );
};
export default Banner;
